import React from 'react';

const Car = (props) => {
    return (
      <div style={{
          border: '1px solid red',
          marginBottom: '10px'
      }}>
          <h2>{props.name}</h2>
          <p><strong>{props.year}</strong></p>
          <input type="text" onChange={props.onChangeName}/>
          <button onClick={props.onClick}>{props.name + ' to title'}</button>
      </div>
    );
};

export default Car;
